INSERT INTO `smf_messages` VALUES (5,5,1,1439644923,2,6,'Charte','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1439645728,'Alexandra','','Introduction:<br><br>Ce forum se veut être un espace de discussions et d\'échanges entre passionnés. Pour que chacun puisse passer un moment en toute convivialité, voici quelques règles de bonne conduite à observer<br><br>1- Objet du forum:<br><br>Ce forum regroupe les membres de Sublime-Voyance. Les thèmes abordés porteront essentiellement sur la parapsychologie sous toutes ses formes. Ce forum a donc pour objectif de faciliter la communication et le partage d\'information.<br><br>2- Modalités d\'accès au forum:<br>Pour prendre connaissance des messages postés sur notre forum, une inscription est obligatoire<br>En effet, la majeure partie des sujets de ce forum peut être lue par tous. En revanche, quelques rubriques sont protégées et seuls les membres adhérents au Staff peuvent poster des messages.<br><br>3- Les règles du forum:<br><br>- Politesse et savoir-vivre: respectez les membres, utilisez des formules de politesse, restez calme.<br>- Tous propos diffamatoires, injurieux, insultants, racistes, xénophobes ou obscènes sont interdits sur le forum.<br>- N\'abusez pas de l\'écriture en majuscules. En effet, ces dernières symbolisent un internaute qui CRIE.<br>- [color=red][b]Pour une lecture agréable de ce forum, nous vous incitons à soigner votre orthographe, votre syntaxe et à ne pas utiliser le langage sms.[/b][/color] Nous vous en remercions par avance.<br><br>4- Le rôle du modérateur:<br><br>Le rôle du modérateur est de faire respecter les règles de bonne conduite pour rendre les espaces de discussions conviviaux et agréables à tous, en adéquation avec les lois du pays (définis par le cadre juridique du pays).<br><br>Les missions du modérateur sont : <br><br>- Supprimer des messages ou des discussions ne respectant pas les règles de bonne conduite.<br>- Supprimer les profils qui nuisent au bon fonctionnement du forum, par exemple via des messages insultants, des messages provocateurs, du prosélytisme religieux ou politique, racistes, xénophobes, etc. <br>- Sont concernés également les utilisateurs qui utilisent simultanément plusieurs profils différents sur le même forum : c\'est une attitude que nous assimilons à de la malhonnêteté envers les autres utilisateurs et donc non admise sur notre forum.<br>- Répondre à vos alertes ou demandes particulières.<br>- Effacer tout propos interdit sur le site tel que par exemple des propos racistes, diffamatoires, insultants, xénophobes, pédophiles... Que ces propos soient explicites ou implicites, ils seront supprimés.<br>- Retirer tout contenu texte, post, photo ou vidéo illicites<br><br>Le modérateur intervient a posteriori et n’intervient pas dans les discussions pour donner son avis, ni lors d’un conflit pour donner raison a un internaute. Si un message vous semble contraire aux règles de bonne conduite énoncées ici, signalez-le au modérateur en cliquant sur le bouton &quot;Modérateur&quot; qui figure en bas de page du forum. Vous pourrez lui envoyer un MP .<br><br>Bien à Vous<br><br>Alexandra: Administrateur','xx',1,0),(6,6,5,1439645485,2,81,'Conditions générales','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1441059666,'Alexandra','','Informations légales<br><br>1. Présentation du site.<br>En vertu de l’article 6 de la loi n° 2004-575 du 21 juin 2004 pour la confiance dans l’économie numérique, il est précisé aux utilisateurs du site la.cote-des-annonces.com l’identité des différents intervenants dans le cadre de sa réalisation et de son suivi :<br><br>Propriétaire : Cote Lionel – Bureau d’étude – 16 rue Casimir Fournier Maubeuge 59600<br><br>Créateur : Cote Lionel<br><br>Responsable publication : Lionel Cote – dg@cote7.com<br><br>Le responsable publication est une personne physique ou une personne morale.<br><br>Webmaster : Cote Lionel – dg@cote7.com<br><br>Téléphone : 0783592721<br><br>Hébergeur : Cote7 – 16 rue Casimir Fournier 59600 Maubeuge<br><br>2. Conditions générales d’utilisation du site et des services proposés.<br>L’utilisation du uuu.sublime-voyance.be implique l’acceptation pleine et entière des conditions générales d’utilisation ci-après décrites. Ces conditions d’utilisation sont susceptibles d’être modifiées ou complétées à tout moment, les utilisateurs du uuu.sublime-voyance.be sont donc invités à les consulter de manière régulière.<br><br>Ce site est normalement accessible à tout moment aux utilisateurs. Une interruption pour raison de maintenance technique peut être toutefois décidée par Cote Lionel, qui s’efforcera alors de communiquer préalablement aux utilisateurs les dates et heures de l’intervention.<br><br>Le uuu.sublime-voyance.be est mis à jour régulièrement par Lionel Cote. De la même façon, les mentions légales peuvent être modifiées à tout moment : elles s’imposent néanmoins à l’utilisateur qui est invité à s’y référer le plus souvent possible afin d’en prendre connaissance.<br><br>3. Description des services fournis.<br>Le uuu.sublime-voyance.be a pour objet de fournir une information concernant l’ensemble des activités de la société.<br><br>Cote Lionel s’efforce de fournir sur le uuu.sublime-voyance.be des informations aussi précises que possible. Toutefois, il ne pourra être tenue responsable des omissions, des inexactitudes et des carences dans la mise à jour, qu’elles soient de son fait ou du fait des tiers partenaires qui lui fournissent ces informations.<br><br>Tous les informations indiquées sur le uuu.sublime-voyance.be données à titre indicatif, et sont susceptibles d’évoluer. Par ailleurs, les renseignements figurant sur le uuu.sublime-voyance.be ne sont pas exhaustifs. Ils sont donnés sous réserve de modifications ayant été apportées depuis leur mise en ligne.<br><br>4. Limitations contractuelles sur les données techniques.<br>Le site utilise la technologie JavaScript.<br><br>Le site Internet ne pourra être tenu responsable de dommages matériels liés à l’utilisation du site. De plus, l’utilisateur du site s’engage à accéder au site en utilisant un matériel récent, ne contenant pas de virus et avec un navigateur de dernière génération mis-à-jour<br><br>5. Propriété intellectuelle et contrefaçons.<br>Cote Lionel est propriétaire des droits de propriété intellectuelle ou détient les droits d’usage sur tous les éléments accessibles sur le site, notamment les textes, images, graphismes, logo, icônes, sons, logiciels.<br><br>Toute reproduction, représentation, modification, publication, adaptation de tout ou partie des éléments du site, quel que soit le moyen ou le procédé utilisé, est interdite, sauf autorisation écrite préalable de : Cote Lionel.<br><br>Toute exploitation non autorisée du site ou de l’un quelconque des éléments qu’il contient sera considérée comme constitutive d’une contrefaçon et poursuivie conformément aux dispositions des articles L.335-2 et suivants du Code de Propriété Intellectuelle.<br><br>6. Limitations de responsabilité.<br>Cote Lionel ne pourra être tenue responsable des dommages directs et indirects causés au matériel de l’utilisateur, lors de l’accès au uuu.sublime-voyance.be , et résultant soit de l’utilisation d’un matériel ne répondant pas aux spécifications indiquées au point 4, soit de l’apparition d’un bug ou d’une incompatibilité.<br><br>Cote Lionel ne pourra également être tenue responsable des dommages indirects (tels par exemple qu’une perte de marché ou perte d’une chance) consécutifs à l’utilisation du forum sublime voyance.be.<br><br>Des espaces interactifs (possibilité de poser des questions dans l’espace contact) sont à la disposition des utilisateurs. Cote Lionel se réserve le droit de supprimer, sans mise en demeure préalable, tout contenu déposé dans cet espace qui contreviendrait à la législation applicable en France, en particulier aux dispositions relatives à la protection des données. Le cas échéant, Cote Lionel se réserve également la possibilité de mettre en cause la responsabilité civile et/ou pénale de l’utilisateur, notamment en cas de message à caractère raciste, injurieux, diffamant, ou pornographique, quel que soit le support utilisé (texte, photographie…).<br><br>7. Gestion des données personnelles.<br>En France, les données personnelles sont notamment protégées par la loi n° 78-87 du 6 janvier 1978, la loi n° 2004-801 du 6 août 2004, l’article L. 226-13 du Code pénal et la Directive Européenne du 24 octobre 1995.<br><br>A l’occasion de l’utilisation du uuu.sublime-voyance.be, peuvent êtres recueillies : l’URL des liens par l’intermédiaire desquels l’utilisateur a accédé au uuu.sublime-voyance.be, le fournisseur d’accès de l’utilisateur, l’adresse de protocole Internet (IP) de l’utilisateur.<br><br>En tout état de cause Cote Lionel ne collecte des informations personnelles relatives à l’utilisateur que pour le besoin de certains services proposés par le uuu.sublime-voyance.be. L’utilisateur fournit ces informations en toute connaissance de cause, notamment lorsqu’il procède par lui-même à leur saisie. Il est alors précisé à l’utilisateur du uuu.sublime-voyance.be l’obligation ou non de fournir ces informations.<br><br>Conformément aux dispositions des articles 38 et suivants de la loi 78-17 du 6 janvier 1978 relative à l’informatique, aux fichiers et aux libertés, tout utilisateur dispose d’un droit d’accès, de rectification et d’opposition aux données personnelles le concernant, en effectuant sa demande écrite et signée, accompagnée d’une copie du titre d’identité avec signature du titulaire de la pièce, en précisant l’adresse à laquelle la réponse doit être envoyée.<br><br>Aucune information personnelle de l’utilisateur du site la.cote-des-annonces.com n’est publiée à l’insu de l’utilisateur, échangée, transférée, cédée ou vendue sur un support quelconque à des tiers. Seule l’hypothèse du rachat de Cote Lionel et de ses droits permettrait la transmission des dites informations à l’éventuel acquéreur qui serait à son tour tenu de la même obligation de conservation et de modification des données vis à vis de l’utilisateur du uuu.sublime-voyance.be.<br><br>Le site susnommé est déclaré à la CNIL sous le numéro 822471 07/10/2002.<br><br>Les bases de données sont protégées par les dispositions de la loi du 1er juillet 1998 transposant la directive 96/9 du 11 mars 1996 relative à la protection juridique des bases de données.<br><br>8. Liens hypertextes et cookies.<br>Le uuu.sublime-voyance.be contient un certain nombre de liens hypertextes vers d’autres sites, mis en place avec l’autorisation de Cote Lionel. Cependant, Cote Lionel n’a pas la possibilité de vérifier le contenu des sites ainsi visités, et n’assumera en conséquence aucune responsabilité de ce fait.<br><br>La navigation sur le uuu.sublime-voyance.be est susceptible de provoquer l’installation de cookie(s) sur l’ordinateur de l’utilisateur. Un cookie est un fichier de petite taille, qui ne permet pas l’identification de l’utilisateur, mais qui enregistre des informations relatives à la navigation d’un ordinateur sur un site. Les données ainsi obtenues visent à faciliter la navigation ultérieure sur le site, et ont également vocation à permettre diverses mesures de fréquentation.<br><br>Le refus d’installation d’un cookie peut entraîner l’impossibilité d’accéder à certains services. L’utilisateur peut toutefois configurer son ordinateur de la manière suivante, pour refuser l’installation des cookies :<br><br>Sous Internet Explorer : onglet outil (pictogramme en forme de rouage en haut a droite) / options internet. Cliquez sur Confidentialité et choisissez Bloquer tous les cookies. Validez sur Ok.<br><br><br>9. Droit applicable et attribution de juridiction.<br>Tout litige en relation avec l’utilisation du uuu.sublime-voyance.be est soumis au droit français. Il est fait attribution exclusive de juridiction aux tribunaux compétents de Paris.<br><br>10. Les principales lois concernées.<br>Loi n° 78-87 du 6 janvier 1978, notamment modifiée par la loi n° 2004-801 du 6 août 2004 relative à l’informatique, aux fichiers et aux libertés.<br><br>Loi n° 2004-575 du 21 juin 2004 pour la confiance dans l’économie numérique.<br><br>11. Lexique.<br>Utilisateur : Internaute se connectant, utilisant le site susnommé.<br><br>Informations personnelles : « les informations qui permettent, sous quelque forme que ce soit, directement ou non, l’identification des personnes physiques auxquelles elles s’appliquent » (article 4 de la loi n° 78-17 du 6 janvier 1978).<br><br>Crédits : les mentions légales ont été générées et offertes par Subdelirium agence web Angoulême','xx',1,0),(7,7,6,1439648865,2,7,'Méthode de cartomancie par Mary Marco et Jeanine Goffinet ','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Si pendant des siècles, l\'instruction a été réservée à une élite et tenue hors de portée de tout un chacun, il n\'en est plus de même maintenant.<br><br>La somme des connaissances exotériques acquises par l\'homme depuis son apparition sur la terre s\'enseigne maintenant à tous, de façon normative, trop parfois, et constitue le bagage culturel de chacun de nous.<br><br>C\'est ainsi que pendant des siècles, le &quot;savoir&quot; s\'est préservé de l\'oppression du rationalisme et du scientisme qui sont en grande partie le fait de notre civilisation occidentale.<br>Au moment où enfin l\'homme commence à reconnaître qu\'il n\'est pas que matière, technique, mais aussi esprit, ce &quot;savoir&quot; peut sortir de l\'ombre et accéder à la lumière, lui qui était notre Lumière.<br><br>Les facultés de l\'esprit, encore si peu connues et si mal employées sont infinies.<br><br>Libéré des contraintes de nos sens imparfaits et des limites étroites de nos normes spatio-temporelles, l\'esprit accède à la connaissance universelle&quot;.<br><br>Toute étude se base sur l\'apprentissage et l\'exercice; nous tous encore en mémoire. anciens écoliers, les longues soirées consacrées à l\'étude et à la répétition, dans la seule compagnie des manuels scolaires, et le souvenir des maîtres d\'école qui nous transmettaient leur savoir.<br><br>La connaissance ésotérique aussi, se transmet et s\'apprend de la même façon; par l\'enseignement du maître et par l\'étude des livres qui réunissent la somme des connaissances.<br><br>Il m \'a été donné au cours de ma carrière d\'enseignant, d\'user nombre de manuels scolaires.<br>Les meilleurs étaient ceux qui, outre une base solide et accessible à tous, renforçaient la théorie par de nombreux exercices attractifs et un langage non-rebutant.<br><br>Le présent livre répond à ces critères.<br><br>Méthode de cartomancie par Mary Marco et Jeanine Goffinet <br><br>Il est né de la rencontre de trois femmes.<br><br>(Depuis les temps immémoriaux, la femme a souvent été dépositaire du savoir ésotérique face à l\'homme aveuglé par le patriarcat et le culte de la raison).<br><br>La première, Marie-Anne Adélaïde Lenormand, a été de son temps u ne devineresse célèbre dont la justesse de prévision a étonné plus d\'un.<br><br>La seconde, Mary Marco, est un de ces êtres qui ont la grâce de dépasser notre espace-temps; elle met ses facultés au service des autres, et convaincue que chacun les a, transmet ses connaissances et encourage le développement du Psi.<br><br>La troisième, Jeanine Goffinet, initialement enseignante, a, depuis sa rencontre avec Mary Marco, progressivement abandonné l\'enseignement traditionnel au profit de la Tradition.<br><br>La connivence, la similitude d \'esprit, de pensée et de cœur et le désir commun de ces dames de transmettre un savoir sont à présent entre vos mains.<br><br>Puissent-elles répondre à votre attente, vous aider à dépasser vos limites et vous ouvrir la &quot;voie royale de la connaissance&quot;.<br><br>J. Mercier<br>Inspecteur pédagogique Recteur de l \'INSPA<br>Administrateur général de 1\'APEL.<br>11','xx',1,0),(8,8,6,1439652735,2,8,'Explication du forum','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Ce forum a été créé pour toute personne enregistrée utilisant le petit Lenormand et ayant envie de partager ses connaissances, les significations des cartes, les différentes combinaisons de jeux.<br><br>Le tout dans la bonne humeur et le respect de chacun<br><br>Allez-y, amusez-vous.','xx',1,0),(9,9,26,1439653476,2,9,'Le petit Lenormand','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Petit Lenormand, Méthode De Cartomancie par Mary Marco et Jeanine Goffinet.<br><br>Un livre intéressant pour les débutants pour commencer petit à petit à comprendre les cartes<br><br>Editions Servranx Bruxelles. <br><br>ISBN 2-87242-030-4<br>','xx',1,0),(10,10,2,1439654054,2,10,'Introduction à la parapsychologie','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','La parapsychologie est l’étude rationnelle, approfondie, et pluridisciplinaire des faits semblant inexplicables en l’état actuel de nos connaissances scientifiques, et mettant en jeu le psychisme et son interaction avec l’environnement.','xx',1,0),(11,11,3,1439654189,2,11,'Le jeu de tarot','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Jeu de 78 cartes (appelées lames), servant au jeu ou à la divination. Jeu qu\'on joue avec ces cartes.','xx',1,0),(12,12,13,1439655132,2,13,'Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1439655448,'Alexandra','','Nous seuls décidons consciemment d\'être heureux,<br>C\'est un choix, je choisis le bonheur.<br>','xx',1,0),(13,12,13,1439655219,2,13,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1439655458,'Alexandra','','Je sais qu\'il n\'y a pas de chemin vers le bonheur,<br>Le bonheur est le chemin.','xx',1,0),(14,12,13,1439655517,2,14,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Être heureux est une décision que nous pouvons tous prendre un jour dans notre vie,<br>Je décide d\'être heureux.<br>','xx',1,0),(15,12,13,1439655539,2,15,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','L\'obstacle majeur à l\'atteinte du bonheur est bien souvent la conviction qu\'on ne le mérite pas.<br>Je mérite le bonheur, j\'en suis convaincu.<br>','xx',1,0),(16,12,13,1439655551,2,16,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Je baigne dans l\'abondance la plus totale.','xx',1,0),(17,12,13,1439655561,2,17,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Je suis une personne extraordinaire,<br>Je m\'apprécie telle que je suis.<br>','xx',1,0),(18,12,13,1439655574,2,18,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Je sais que j\'ai plus de pouvoir sur ma vie que ce que je crois.','xx',1,0),(19,13,10,1439656707,2,19,'Esotérique','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Ce terme, dont le sens diffère de façon notable selon les époques et les auteurs, est parfois utilisé dans la culture populaire pour parler de courants de pensée marginaux à composante secrète ou étrange (sociétés secrètes, occultisme, paranormal, etc.)','xx',1,0),(20,14,4,1439657091,2,20,'Clairvoyance','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Faculté de voir avec clarté, sagacité, pénétration, lucidité.<br>Analyser une situation avec clairvoyance.<br>Forme de perception extrasensorielle d\'objets ou d\'événements.','xx',1,0),(21,15,3,1439657659,2,21,'Les secrets de la tarologie','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Le tarot divinatoire est l\'application de la cartomancie aux cartes du tarot de Marseille ou de ses variantes historiques ou modernes. C\'est un art divinatoire qui utilise toutes ou une partie des 78 cartes du tarot de Marseille. Suivant le contexte d\'utilisation – oracle ou approche plus psychologique – cette pratique d\'interprétation des cartes est diversement désignée par différents néologismes, par exemple tarologie.','xx',1,0),(22,16,7,1439657781,2,22,'Pendule ou tout autre objet','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','La radiesthésie est un procédé de détection fondé sur la sensibilité des êtres vivants à certaines radiations qu\'émettraient différents corps. Elle permettrait de localiser des sources, retrouver un objet perdu, un trésor ou une personne disparue, établir un diagnostic médical, déterminer la profondeur d\'un puits, etc.','xx',1,0),(23,16,7,1439657863,2,23,'Re : Pendule ou tout autre objet','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Sensibilité hypothétique des êtres vivants à certaines radiations, connues ou inconnues.<br>Procédé divinatoire permettant d\'exercer cette sensibilité à l\'aide d\'une baguette (rhabdomancie) ou d\'un pendule tenus à la main.','xx',1,0),(24,17,8,1439659055,2,24,'Le pouvoir des pierres et des cristaux','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','La lithothérapie est une médecine non conventionnelle qui cherche à soigner par le biais des cristaux (améthyste, quartz, œil de tigre, labradorite, aigue-marine, rubis, turquoise, etc.) Elle considère que les cristaux émettent naturellement une « résonance » ou une « vibration » singulière capable d\'améliorer le bien-être de la personne à son contact ou à proximité.<br>[size=2]Il n\'y a pas de preuves scientifiques de l\'efficacité de cette thérapie ou de l\'existence d\'une « énergie » spécifique aux cristaux.&nbsp;[/size]','xx',1,0),(25,18,9,1439659868,2,25,'L\'énergie par le Reiki','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Le dictionnaire Oxford donne la définition suivante du mot Reiki : « Le Reiki est une technique de soin énergétique par laquelle le thérapeute canalise et transmet l’énergie au patient par imposition des mains pour activer les processus naturels de guérison. »<br>Cette thérapie de soin énergétique, ancienne et très puissante, agit aux niveaux physique, psychologique et spirituel. Elle améliore la santé, favorise la guérison des traumatismes émotionnels, le développement personnel et l’évolution spirituelle.<br>Parfois, le Reiki aide là où aucun résultat n’avait été atteint auparavant.<br>Le praticien Reiki ne travaille pas avec sa propre énergie mais canalise l’Énergie Universelle qui possède une grande force vitale.<br>Le Reiki est reconnu par les assurances maladie dans plusieurs pays tels que la Suisse, l’Allemagne et utilisé dans les hôpitaux au Canada et aux États-Unis.','xx',1,0),(27,20,14,1439670178,2,57,'Alexandra','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1440522414,'GrCOTE7','tél + visible','[size=2]Bonjour, [/size]<br><br><br>[size=2]Je me nomme Alexandra.[/size]<br><br><br>Mes grands-mères tant paternelles que maternelles possédaient un don de voyance.<br>J’ai pris conscience assez jeune que j’avais fréquemment de fortes intuitions qui se révélaient exactes.<br>Après plusieurs années de réflexion, j’ai décidé de vous faire bénéficier de ce don et ainsi apporter des réponses claires à vos questions. Lever jusqu’au moindre de vos doutes et incertitudes en relation à votre passé, votre présent et votre futur, vous aider à réparer vos blessures intérieures afin de rendre meilleur votre quotidien.<br>Indépendamment de mon ressenti, je conforte mes prédictions par le maniement du pendule et la maîtrise de divers tarots dont le Petit Lenormand et l’Ancien Tarot de Marseille.<br>Je serai heureuse de pouvoir vous accueillir sur ma ligne et concourir à éclairer tous sujets dans le domaine familial aussi bien que financier, affectif, professionnel et autres. Et également pouvoir partager avec vous les joies retrouvées.<br><br><br>Testez-moi gratuitement, envoyez une question, accompagnée de votre nom, prénom, date de naissance et région.<br>Je vous répondrai maximum dans les 48 heures.<br><br>[size=2]alexandra@sublime-voyance.be[/size]<br><br>[iurl=http://http//alexandra.sublime-voyance.be/][size=2]http://http://alexandra.sublime-voyance.be/[/size][/iurl]<br><br>[size=2]Si vous le désirez, n&#39;hésitez pas à me téléphoner au [b]0 907/37 157[/b] &nbsp;1,50€ &nbsp;min &nbsp;7/7j[/size]<br><br>À très bientôt…','xx',1,0),(28,21,12,1439671352,2,28,'Le Forum','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Le bistrot du coin, est là pour discuter d\'un sujet ou l\'autre.&nbsp;<br>Par contre, vous pouvez contribuer aux sujets des forums, soit en y créant des nouveaux ,&nbsp;soit tout simplement en répondant aux sujets déjà créés.&nbsp;<br>Osez poser des questions, émettre vos idées, proposer des actions....<br><br>Alexandra<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;','xx',1,1),(29,22,15,1439673251,3,29,'Pauline','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1439674786,'Alexandra','','Depuis plusieurs années, mon but est l\'aide aux personnes en attente d\'un éclaircissement.<br><br>J\'ai développé beaucoup d intuitions.&nbsp;<br><br>Des doutes? Des hésitations???<br>Ne restez pas dans le flou...<br><br>Étant à votre écoute, je vous réponds avec franchise et honnêteté.<br><br>Je suis medium clairvoyante et passionnée par ce besoin d\'aide à autrui.<br><br>Les cartes, tarots, oracles tirés sont un ensemble de réponses que je vous expliquerai clairement par l\'intuition que j\'ai développé dans ce domaine.<br><br>Profitez d\'une réponse GRATUITE à la question de VOTRE choix ! Mentionnez votre prénom, date de naissance et région.<br><br>pauline@sublime-voyance.be<br><br>N\'hésitez pas à me téléphoner au 0907/37 153 &nbsp;1,50€ min 7/7j<br><br>A bientôt<br>','xx',1,0),(30,12,13,1439732927,2,30,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Je sais que j\'ai beaucoup plus de potentiel et de valeur que ce que je pense.','xx',1,0),(31,12,13,1439797794,2,31,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Je crois à l\'abondance, je désire l\'abondance, je reçois l\'abondance.','xx',1,0),(34,23,16,1439818599,1,34,'Manuel du Mod News','GrCOTE7','GrCOTE7@sublime-voyance.be','91.178.135.63',1,0,'','','[right][b]Description[/b][/right]<br>Allows anyone (including guests) to subscribe to an automatically generated weekly. fortnightly or monthly email newsletter. &nbsp;Guests need to enter their email address, registered members don\'t. &nbsp;The subscription options shows above the board index and (optionally) during forum registration.<br><br>The Newsletter can optionally contain forum stats, the latest news item, recent topics list, upcoming events from the calendar, video links (included in posts), and recent picture from SMF Gallery (if installed) - the newsletter email always includes an unsubscribe link.<br><br>Features:<br>[list]<br>[li]Newsletter can be subscribed to during initial forum registration or at any time[/li]<br>[li]Newsletter frequency can be selected by the user when subscribing (weekly, fortnightly or monthly)[/li]<br>[li]Frequency timer starts from when the user subscribes (to reduce server email load).[/li]<br>[li]Subscriber can unsubscribe on the forum OR by clicking an &quot;unsubscribe&quot; link in the Newsletter.[/li]<br>[li]Newsletter sub/unsubscribe options show above OR below forum list.[/li]<br>[li]Newsletter is HTML formatted (includes plain text version) using forum name and logo image (styling can be edited).[/li]<br>[li]Portal PHP block code included (to allow newletter subscription options to appear on any portal page (using a custom portal PHP block)[/li]<br>[/list]<br><br>Admin Settings:<br>[list]<br>[li]Allow guest to subscribe to the newsletter.[/li]<br>[li]Use guest permissions when selecting topics, videos and pictures to include.[/li]<br>[li]Choose position of Subscribe/Unsubscribe buttons (top or bottom of forum listing)[/li]<br>[li]Chose whether subscribtion option is shown during forum registration[/li]<br>[li]Number of recent topic titles/links to include in the newsletter (set to 0 to exclude topics from the newsletter)[/li]<br>[li]Select which boards to exclude when selecting topics[/li]<br>[li]Number of recent videos to include (set to 0 to exclude videos from the newsletter)[/li]<br>[li]Select which boards to exclude videos from[/li]<br>[li]Include SMF Gallery pictures[/li]<br>[li]Gallery categories to ignore[/li]<br>[li]Include basic forum stats[/li]<br>[li]Include the latest news item (the SMF newsfader doesn\'t have to be enabled)[/li]<br>[li]Include basic forum stats[/li]<br>[li]Include calendar events[/li]<br>[li]Manual subscribtion removal by email address - allows deletion of invalid or bouncing emails[/li]<br>[li]Newletter CSS styling can be edited in the SMF Language Editor[/li]<br>[li]Newletter can be previewed before activating.[/li]<br>[/list]<br><br>Note that unless you have selected guest permissions or exclude some board(s) then the titles of (and links to) new topics that appear in ALL boards will be included in the newsletter even if the recipient does not have permission to read the topic post itself. &nbsp;This can be used as a way to encourage forum or group membership by showing topic titles but not allowing access to the content.<br><br>To change the CSS styling of the newsletter:<br>[i]Admin-&gt;Configuration-&gt;Languages-&gt;Edit Languages-&gt;(whatever your langueg is called)-&gt;edit Languages Entries -&gt; select &quot;Modifications&quot;[/i]<br>... find and edit the CSS string &quot;newsltr_email_style&quot;<br><br><br>Requirements:<br>PHP version 5.2 or higher<br>SMF version 2.0 or higher<br><br>[b]Note[/b]:&nbsp;<br>On some web hosts you may need to disable compression in SMF (if the newletter preview shows a blank page):<br>Admin-&gt;Configuration-&gt;Server Settings-&gt;General and clear enable compressed output option<br><br>[b]Adding Newsletter Subscription to a Portal page[/b]<br>You can add the newsletter subscription options on any portal page (if it supports custom PHP code blocks - EzPortal, SimplePortal, etc.) &nbsp;After installing this mod, create a new custom PHP block in your portal (see portal instaructions) and paste the code from the file [b]portal_block.php[/b], included in this zip package into the new block.<br><br>[i]Updates:[/i]<br>[size=8pt]v1.25<br>added subscribe on register feature<br>v1.23<br>fixed portal_block.php syntax error<br>added more robust check for SMF Gallery<br>v1.22<br>fixed bug in video inclusion code (shows in error log)<br>added sample portal PHP block code<br>v1.21<br>fixed SMF_Gallery detection bug in adminsettings&nbsp;<br>v1.20<br>Cleaned up HTML format imporving email client compatibility<br>Newsletter can include SMF Gallery pictures and YouTube videos (from posts)<br>v1.14<br>Now works properly on forums with unsupported languages (reverts to english)<br>v1.13<br>moved newsletter CSS style to languages - can now be edited by an admin<br>....<br>[/size]<br><br>License:<br>Copyright 2012/2013 John Robertson<br>Released under the GNU/GPL license<br><br>&nbsp; &nbsp; This is free software: you can redistribute it and/or modify<br>&nbsp; &nbsp; it under the terms of the GNU General Public License as published by<br>&nbsp; &nbsp; the Free Software Foundation, either version 3 of the License, or<br>&nbsp; &nbsp; (at your option) any later version.<br><br>&nbsp; &nbsp; This software is distributed in the hope that it will be useful,<br>&nbsp; &nbsp; but WITHOUT ANY WARRANTY; without even the implied warranty of<br>&nbsp; &nbsp; MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE. &nbsp;See the<br>&nbsp; &nbsp; GNU General Public License for more details.<br>','xx',1,0),(35,12,13,1439851880,2,35,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','91.178.135.63',1,0,'','','Je suis reconnaissant et je me réjouis d\'une vie pleine d\'abondance.','xx',1,0),(36,24,17,1439853574,2,36,'Les maîtres qui nous gouvernent','Alexandra','alexandra7voyante@gmail.com','91.178.135.63',1,1439884210,'GrCOTE7','','[size=2]On attribue à chaque signe du zodiaque un astre qui est son Maître et qui le gouverne, dans lequel ce dernier se trouve en Domicile Diurne[/size]<br><br>[list]<br>[li][size=2]Mars est le maître du signe du Bélier[/size][/li]<br>[li][size=2]Vénus est le maître du signe du Taureau[/size][/li]<br>[li][size=2]Mercure est le maître du signe des Gémeaux[/size][/li]<br>[li][size=2]La lune est le maître du signe Cancer[/size][/li]<br>[li][size=2]Le soleil est le [/size]maître[size=2] du signe Lion[/size][/li]<br>[li][size=2]Mercure est le maître de la Vierge[/size][/li]<br>[li][size=2]Vénus est le maître du signe de la Balance[/size][/li]<br>[li][size=2]Mars et secondairement Pluton, sont les maîtres du signe du Scorpion[/size][/li]<br>[li]Jupiter est le maître du signe du Sagittaire[/li]<br>[li]Saturne est le maître du signe du Capricorne[/li]<br>[li]Saturne et secondairement Uranus, sont les maîtres du signe du Verseau[/li]<br>[li]Jupiter et secondairement Neptune, sont les maîtres du signe des Poissons[/li]<br>[/list]<br>','xx',1,1),(40,12,13,1439972872,2,40,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Je ressens le bonheur et la béatitude d\'être en vie.','xx',1,0),(43,12,13,1440053569,2,43,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Plus je m&#39;aime et plus je m&#39;apprécie,<br>[size=2]Plus j&#39;avance dans la vie.[/size]','xx',1,0),(45,12,13,1440118006,2,45,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','En toutes circonstances, je me sens calme et maître de moi-même.','xx',1,0),(46,31,18,1440153513,2,49,'Les signes de feu et leur professions','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1440230074,'Alexandra','','[b][size=2]Bélier[/size][/b]<br>[size=2][size=2]Les métiers en rapport &nbsp;avec les métaux, le feu &nbsp;(rôtisseur ou pompier,· par &nbsp;exemple). &nbsp;Les &nbsp;branches de &nbsp;la &nbsp;médecine &nbsp;en &nbsp;rapport &nbsp;avec &nbsp;la &nbsp;tête, visage &nbsp;(ex; &nbsp;neurochirurgien , oculiste, etc.). [/size][/size]<br>[size=2]Les &nbsp;métiers &nbsp;de &nbsp;l&#39;armée. professions &nbsp;sportives. &nbsp;Et &nbsp;aussi: &nbsp;guide, &nbsp;berger, &nbsp;éclaireur , &nbsp;armurier, coiffeur, acupuncteur, &nbsp;humoriste, &nbsp;vulcanologue , etc.[/size]<br><br>[b]Lion[/b]<br>Les professions liées aux loisirs, aux jeux, aux vacances et aux enfants. Les métiers en rapport [size=2]avec l &#39;or , les bijoux, les m usées . Les métiers de la mode et du théâtre (comédien , mannequin [/size][size=2]...). En médecine: cardiologue, vertébrothérapeute. &nbsp;Les professions ayant un caractère [/size][size=2]prestigieux &nbsp;comme [/size][size=2]la &nbsp;fonction &nbsp;d&#39;ambassadeur.[/size]<br><br>[b]Sagittaire[/b]<br>Les métiers du sport comme cavalier, chasseur ou tireur à l&#39;arc ... Les [size=2]professions liées aux études supérieures. Les métiers liés aux voyages, aux [/size][size=2]pays étrangers. [/size][size=2]Et aussi: philosophe, explorateur, homme d&#39;Église, conférencier, théologien[/size][size=2], gourou, médecin spécialiste du sang, des artères ou des jambes.[/size]<br>','xx',1,0),(47,32,18,1440156108,2,49,'Les signes de Terre et leur professions','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1440230046,'Alexandra','','[b][size=2][font=Verdana, sans-serif]Taureau[/font][/size][/b]<br>[size=2][font=Verdana, sans-serif][size=2]Les métiers en rapport avec l&#39;argent (telle la banque) . Les métiers de la terre &nbsp;et &nbsp;ceux &nbsp;de &nbsp;l&#39;immobilier. Les &nbsp;professions &nbsp;concernant &nbsp;la &nbsp;nourriture (ex: cuisinier). Certains métiers artistiques (ex: chanteur,[/size][/font][size=2][font=Verdana, sans-serif]décorateur modiste). Les branches de la médecine concernant la bouche, la voix, la gorge et les vertèbres cervicales.[/font][/size][/size]<br><br>[b][size=2][font=&#39;Segoe UI&#39;, sans-serif]Vierge[/font][/size][/b]<br>[size=2][font=&#39;Segoe UI&#39;, sans-serif]Toutes les professions &nbsp;de la médecine &nbsp;en général, mais principalement les généralistes , les infirmiers , les pharmaciens et les gastro-entérologues.[/font][/size]<br>[size=2][font=&#39;Segoe UI&#39;, sans-serif]Tous les métiers où entre une notion d&#39;analyse, de mesure , de calcul comme statisticien , sondeur, comptable, géomètre ou analyste. Tous les métiers &nbsp;de &nbsp;service &nbsp;et &nbsp;aussi: &nbsp;dessinateur , &nbsp;zoologue, &nbsp;vétérinaire, homéopathe, volailler, herboriste , expert, etc.[/font][/size]<br><br>[b]Capricorne[/b]<br>Les professions administratives. Les métiers en rapport avec la montagne. [size=2]Les professions en rapport avec le froid , les mines, la pierre, l&#39;immobilier. [/size][size=2]En médecine: gériatrie , rhumatologue, ostéopathe, dermatologue. [/size][size=2]Et aussi: archiviste, préhistorien , paléographe , paléontologue , géologue, [/size][size=2]relieur, académicien, encyclopédiste, évêque, cardinal, sculpteur. ..[/size]','xx',1,0),(48,33,18,1440156167,2,49,'Les signes d\'Air et leur proffessions','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1440230001,'Alexandra','','[size=2][size=2][font=Verdana, sans-serif][b]Gémeaux[/b][/font][/size][/size]<br>[size=2][size=2][font=Verdana, sans-serif]Tous les métiers de la communication et des transports (journaliste,[/font][/size][size=2][font=Verdana, sans-serif]écrivain, éditeur, facteur, libraire, etc.). Certains sports comme les coureurs [/font][/size][size=2][font=Verdana, sans-serif]à pied, les cyclistes, les gymnastes et les tennismen. Les professions du [/font][/size][size=2][font=Verdana, sans-serif]commerce en boutique ou sur les marchés. En médecine: les spécialistes des poumons ou de la circulation.[/font][/size][/size]<br><br>[b]Balance[/b]<br>Tous les métiers où l&#39;équilibre est important comme ceux de danseur ,[size=2]gymnaste ou équilibriste. Toutes les professions de la justice (avocat, [/size][size=2]juge, etc.) .[/size]<br>Les métiers de la beauté, de l&#39;esthétique ou de la décoration. Certaines [size=2]professions artistiques comme peintre ou styliste.[/size]<br>En médecine: urologue, néphrologue et diabétologue. Et aussi: professeur [size=2]de musique et les métiers en rapport avec les poids (ascenseur ... ).[/size]<br><br>[b]Verseau[/b]<br>[size=2]Les métiers liés à la politique et à des organismes internationaux comme [/size][size=2]l&#39;ONU ou !&#39;Unesco. Toutes les professions modernes , nouvelles. Toutes [/size][size=2]les professions liées aux moyens actuels de communication ou de transport [/size][size=2](télex, informatique, aviation, télévision, cinéma, etc.). [/size][size=2]Et aussi: écrivain de science-fiction , astrologue , psychologue, électronicien, [/size][size=2]publiciste, radiologue. phlébologue, ingénieur, [/size][size=2]magnétiseur, parapsycbologue [/size][size=2]et les carrières de l&#39;automobile.[/size]<br>','xx',1,0),(49,34,18,1440156210,2,49,'Les signes d\'Eau et leur professions','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1440229665,'Alexandra','','[b]Cancer[/b]<br>Les métiers en rapport avec la nourriture (ex: restaurateur) . Les métiers de la &nbsp;navigation . [size=2]Ceux concernant le domicile (ex.: décorateur, notaire, agent immobilier , etc.) En médecine : [/size][size=2]stomatologue, cancérologue, sage­-femme ... Les professions en rapport avec le passé comme [/size][size=2]historien . Les fonctions électives au sein d&#39;une mairie .[/size][size=2]Et aussi les romanciers, &nbsp;les cafetiers, etc.[/size]<br><br>[b]Scorpion[/b]<br>Les professions en rapport avec la sexualité comme sexologue, psycha[size=2]nalyste. .. Professions particulières comme ésotériste, magicien [/size][size=2]médium ... Les métiers en rapport avec la mort comme fossoyeur ou gardien [/size][size=2]de cimetière. Et aussi: herpétologiste, scaphandrier, archéologue, spéléologue, [/size][size=2]chercheur de trésor, atomiste ou scientifique travaillant sur le [/size][size=2]nucléaire.[/size]<br><br>[b]Poissons[/b]<br>[size=2]Les professions liées aux hôpitaux , aux prisons , à tous les lieux clos. En&nbsp;[/size][size=2]médecine: les psychiatres, les guérisseurs, les podologues et les thalassothérapeutes.&nbsp;[/size][size=2]Les métiers de la photographie , de l&#39;image.&nbsp;[/size][size=2]Et aussi: pétrolier, pêcheur, prêtre, évangéliste , espion , poète , sous-marinier, maître-nageur, agent de répression des fraudes et de stupéfiants.[/size]<br>','xx',1,0),(50,35,19,1440231088,2,69,'Bélier','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1440671783,'Alexandra','','Le signe du Bélier représente une poussée irrésistible vers le futur, une projection en avant, il ne connait pas les risques.&nbsp;<br>C&#39;est le signe pionnier du zodiaque, celui qui ose aller le premier là où nul n&#39;est encore allé, car sa folie visionnaire le pousse parfois vers un nouveau monde.<br>Il apporte de l&#39;élan, de l&#39;enthousiasme, de l&#39;action. Il a le goût du risque. I<br>ll est dynamique: c&#39;est un fonceur, un pionner, un conquérant.&nbsp;<br>C&#39;est un signe d&#39;impulsion, de génération, d&#39;ardeur et d&#39;audace. Il représente ce qui débute et celui qui prends la tête d&#39;un mouvement.&nbsp;<br>C&#39;est aussi celui qui a des coups de tête, qui n&#39;en fait qu&#39;à sa tête.&nbsp;<br>Le Bélier s&#39;enflamme, a de l&#39;initiative, de l&#39;énergie. Le Bélier est fort, brave et recherche le succès. Il est ambitieux et imprudent. Il veut être le premier.','xx',1,0),(51,36,19,1440231507,2,69,'Taureau','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1440671911,'Alexandra','','Après la période de tension et d’agressivité du bélier, celle du Taureau est beaucoup plus sereine, plus paisible encore qu&#39;il y ait souvent une certaine violence contenue dans l&#39;acte de procréation. <br>Il est terre à terre, matérialiste, il thésaurise, il aura un compte en banque bien rempli.&nbsp;<br>Il apporte la stabilité, le réalisme et la ténacité. <br>Il est obstiné, possessif, jaloux, attractif et charmeur. <br>Il représente la patience, la persévérance, la fertilité, l&#39;acquisition (argent ou nourriture). <br>Il est conservateur, fidèle et a besoin de confort et de sécurité. Il exprime l’opiniâtreté, la jouissance, l&#39;intérêt, la colère et la sensualité. <br>Il représente la terre, le terrain. <br>Ce signe est un accumulateur, un conservateur. <br>Son caractère statique est le principal trait de sa personnalité. Il fixe la réalité et le temps. Chez lui on sème à tous vents.','xx',1,0),(52,12,13,1440246570,2,52,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Je cultive le calme.','xx',1,0),(53,37,20,1440249620,2,53,'Participation active au forum','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1440257398,'Alexandra','','[size=2][size=2]Bonjour, bonsoir, le staff du forum aimerait une participation active de ses membres et nouveau membre au niveau des différents sujets proposés, afin, d&#39;avoir une animation et d&#39;obtenir un forum vivant.[/size][/size]<br><br>Et que ce forum puisse venir en aide aux personnes qui se posent des questions sur leur vie, leur futur, leur moral. Que nous puissions les aider à rester positif et à évoluer vers le meilleur d&#39;eux même.','xx',1,1),(54,38,19,1440278092,2,69,'Gémeaux','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1440671983,'Alexandra','','Il représente la diffusion, la communication, le mouvement, le déplacement, et la curiosité.&nbsp;<br>Il exprime la dualité, mais aussi l&#39;intelligence.&nbsp;<br>C&#39;est le signe des chiffres et des lettres, de l&#39;addition et de la multiplication.&nbsp;<br>Il a des idées mais est souvent angoissé et complexé.&n