gne de l&#39;inconscient, de l&#39;enfance, du passé, de la foule et du public et de la démocratie.&nbsp;<br>Il apporte l&#39;inconstance, la mémoire, la fantaisie, la comédie, le caprice, les fluctuations et les changements d&#39;humeur.&nbsp;<br>Il a besoin de sécurité, de rêve, de poésie.&nbsp;<br>C&#39;est la cave, les grottes et les cavernes.<br>Ses sentiments sont affectueux, tendres, maternels, parfois instables ou infantiles.&nbsp;<br>Il y a souvent un un refus de toute affirmation de soi ressentie comme une projection dans l&#39;avenir, qui est compensé par une réceptivité et une intuition aiguës. Évidemment, tout ce qui a trait au passé est exalté.','xx',1,0),(60,40,19,1440597564,2,69,'Lion','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1440672195,'Alexandra','','C&#39;est le signe de la puissance, de la royauté, de l&#39;éclat, de tout ce qui brille.&nbsp;<br>C&#39;est le signe de la divinité (le soleil).&nbsp;<br>I[size=2]l apporte générosité, orgueil, gloire, mise en vedette, noblesse, idéalisme, rayonnement, flatterie et arrivisme.&nbsp;[/size]<br>[size=2]Il a des &quot;coups de coeur&quot;! C&#39;est le signe de l&#39;amour, du coeur, de la création (création artistiques ou enfants).&nbsp;[/size]<br>[size=2]Il a des goûts de luxe. Il a besoin d&#39;être le centre d&#39;intérêt. Il aime les plaisirs, les fêtes et les loisirs. C&#39;est la chaleur et la sécheresse.&nbsp;[/size]<br>[size=2]Il représente l&#39;éducation, les dons artistiques et notamment les dons de comédien. C&#39;est aussi l&#39;ambition, l&#39;autorité, la franchise, la confiance, l&#39;expression de soi, la passion, la vanité et la tyrannie.&nbsp;[/size]<br>[size=2]Le natif du Lion voit grand. Il veut tout et tout de suite.&nbsp;[/size]<br>[size=2]Il est chaleureux, optimiste.&nbsp;[/size]<br>[size=2]Pour lui, vouloir, c&#39;est pouvoir et obtenir.&nbsp;[/size]<br>[size=2]Ce comportement naturellement positif et dominateur force la chance et le destin. Tout est là, à sa disposition. Car l&#39;enfant naît à l&#39;époque de la récolte et des moissons.[/size]<br><br><br><br><br><br><br><br><br><br><br><br><br>','xx',1,0),(61,12,13,1440663138,2,61,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','J&#39;essaie de voir le côté humoristique des choses,<br>Je surmonte mes déceptions en n&#39;en faisant pas des montagnes.','xx',1,0),(66,42,12,1440664278,2,66,'Images','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Que du bonheur !','clip',1,1),(67,42,12,1440664569,2,67,'Re : Images','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','',' :) ','clip',1,1),(68,42,12,1440664692,2,68,'Re : Images','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','',' :) ','clip',1,1),(69,42,12,1440664816,2,69,'Re : Images','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1440664949,'Alexandra','',' :) ','clip',1,1),(70,43,19,1440675223,2,70,'Vierge','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','C&#39;est le signe de l&#39;analyse, de la méthode, de l&#39;organisation, de la classification et de la mesure.&nbsp;<br>Il est logique, timide, perfectionniste, manique, travailleur, pratique, serviable, raisonnable, critique et égoïste.<br>Il est soucieux du moindre détail.<br>Il est angoissé. Il refuse toute pénétration, fécondation ou violation.&nbsp;<br>Il est mystérieux et virginal. C&#39;est le signe de la médecine, de la diététique, de la santé et des maladies bénignes, et ou , psychosomatiques.<br>Il représente l&#39;hygiène, la ménagère, les tâches quotidienne et répétitives au foyer.<br>C&#39;est le signe des animaux. C&#39;est un signe technique et ingénieux. Il représente la division et la soustraction.<br>Il a peur de l&#39;inconnu, des surprises et se sent limité. Signe du service.<br>Malgré ses défauts, il a beaucoup de qualités, il est prudent, esprit critique et autocritique, méthodique, sens de l&#39;organisation, de l&#39;analyse, honnêteté, serviabilité, simplicité, humilité.&nbsp;<br>Toutefois, de telles qualités peuvent inhiber toute expression spontanée des émotions et de la sensibilisé, interdire tout abandon ou tout laisser aller, rendre le sujet m&quot;méticuleux, maniaque, dépressif.<br>On dit communément que le signe de la Vierge est le serviteur du Zodiaque. Il s&#39;agit alors, pour le natif de ce signe, d&#39;apprendre à différencier la serviabilité et l’asservissement.','xx',1,0),(71,12,13,1440838119,2,71,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Désormais je savoure chacune de mes actions.','xx',1,0),(72,12,13,1440925778,2,72,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','J&#39;agis dans un sens toujours positif.','xx',1,0),(73,44,12,1440946583,2,73,'Détente','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','[color=#222222][size=4][font=arial, sans-serif]PETIT ROBERT 2011 est sorti...[/font][/size][/color]<br>[quote][table][tr][td][table][tr][td][table][tr][td][table][tr][td][table][tr][td][size=4][b]La beauté intérieure[/b]&nbsp;: Concept inventé par les moches pour pouvoir se reproduire.&nbsp;[/size]<br>[size=4]<br>[b]Sudoku[/b]&nbsp;: Qui à le Sudoku à le Nord en face.&nbsp;[/size]<br>[size=4]<br>[b]Porte-clefs[/b]&nbsp;: Invention très pratique qui permet de perdre toutes ses clefs d’un coup au lieu de les perdre une par une.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;[/size]<br><br>[b][size=4]Cellulite[/size][/b][size=4]&nbsp;[/size][size=4]: Couche graisseuse qui enveloppe souvent les femmes, mais emballe rarement les hommes…[/size]<br>&nbsp;<br>[b][size=4]Etat[/size][/b][size=4]&nbsp;[/size][size=4]: Système mafieux le mieux organisé de tous les temps&nbsp;[/size]<br>&nbsp;<br>[b][size=4]Cravate[/size][/b][size=4]&nbsp;[/size][size=4]: Accessoire servant à indiquer la direction du cerveau de l’homme&nbsp;[/size]<br>[size=4]<br>[b]Carla Bruni[/b]&nbsp;: Blanche-neige moderne ayant eu une préférence pour un des sept nains : Grincheux&nbsp;[/size]<br>[size=4]<br>[b]Maison Blanche[/b]&nbsp;: Actuellement Barack noire&nbsp;[/size]<br>[size=4]<br>[b]Voiture[/b]&nbsp;: Invention ingénieuse, permettant de contenir 110 chevaux dans le moteur et un âne au volant&nbsp;[/size]<br>[size=4]<br>[b]Maquillage[/b]&nbsp;: Opération qui consiste à tuer des baleines pour décorer des thons&nbsp;[/size]<br>[size=4]<br>[b]Parents[/b]&nbsp;: Deux personnes qui t&#39;apprennent à marcher et à parler pour ensuite te dire de t&#39;asseoir et de fermer ta gueule&nbsp;[/size]<br>[size=4]<br>[b]Titeuf&nbsp;[/b]: Ce qui sort de la TitePoule&nbsp;[/size]<br>[size=4]<br>[b]Orteil[/b]&nbsp;: Appendice servant a détecter les coins de portes&nbsp;[/size]<br>[size=4]<br>[b]Egalité des sexes&nbsp;[/b]: Nouveau concept créé par les hommes pour ne plus payer le restaurant&nbsp;[/size]<br>[size=4]<br>[b]Monter un meuble Ikea&nbsp;[/b]: Expression moderne signifiant &quot;passer un week-end de merde&quot;&nbsp;[/size]<br>[size=4]<br>[b]Etre au bout du rouleau&nbsp;[/b]: Situation très peu confortable, surtout quand on est aux toilettes&nbsp;[/size]<br>[size=4]<br>[b]Facebook[/b]&nbsp;: Le seul endroit où tu parles à un mur sans être ridicule&nbsp;[/size]<br>[size=4]<br>[b]Boule de flipper&nbsp;[/b]: Testicule de dauphin&nbsp;[/size]<br>[size=4]<br>[b]Le ton monte&nbsp;[/b]: Façon familière de signaler qu&#39;une femme moche prend l&#39;ascenseur&nbsp;[/size]<br>[size=4]<br>[b]Oui-Oui&nbsp;[/b]: Fils illégitime de Sissi&nbsp;[/size]<br>[size=4]<br>[b]GPS[/b]&nbsp;: Seule femme que les hommes écoutent pour trouver leur chemin[/size][/td]<br>[/tr]<br>[/table]<br>[/td]<br>[/tr]<br>[/table]<br>[/td]<br>[/tr]<br>[/table]<br>[/td]<br>[/tr]<br>[/table]<br>[/td]<br>[/tr]<br>[/table]<br>[/quote]<br>','xx',1,0),(74,44,12,1440947428,2,74,'Re : Détente','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','[size=2][b]La saison des barbecues a commencé ! A cet effet, il est bon de se rappeler la procédure habituelle de cette cuisine estivale.&nbsp;[/b][/size]<br>&nbsp; &nbsp;<br>Le barbecue :<br>C&#39;est dans cette activité qu&#39;on reconnaît les talents de cuisine d&#39;un homme, un vrai.<br>Dès qu&#39;un homme se porte volontaire pour faire ce type de cuisine, la chaîne d&#39;évènements suivante est actionnée :&nbsp;<br>&nbsp;<br>[b]L&#39;HOMME[/b]<br>1. L&#39;homme sort le barbecue et le charbon de bois. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br>[b]LA FEMME[/b]<br>2. La femme nettoie la grille.<br><br>3. La femme va à l&#39;épicerie<br>&nbsp;<br>4. La femme va chez le boucher.<br>&nbsp;<br>5. La femme va chez le pâtissier.<br>&nbsp;<br>6. La femme prépare la salade et les légumes.<br>&nbsp;<br>7. La femme prépare la viande pour la &nbsp;cuisson<br>&nbsp;<br>8. La femme la place sur un plateau avec les ustensiles nécessaires, les épices et les herbes.<br>&nbsp;<br>9. La femme apporte la grille propre et le plateau à l&#39;homme qui est étendu à côté du barbecue en train de prendre une bière.<br>[b]10. L &#39;homme place la viande sur la grille.[/b]<br><br><br>11. La femme va à l&#39;intérieur mettre la table.<br>12. La femme vérifie la cuisson des légumes.<br>&nbsp;<br>13. La femme prépare le dessert.<br>&nbsp;<br>14. La femme revient à l&#39;extérieur pour dire à son mari que la viande est en train de brûler.<br>[b]15. L’homme enlève la viande trop cuite de la grille et l&#39;apporte à la femme.[/b]<br>16. La femme prépare les assiettes et les apporte sur la table.<br>[b]17. L’homme sert à boire.[/b]<br>18. La femme dessert la table et prépare le café.<br>&nbsp;<br>19. La femme sert le café et le dessert<br>&nbsp;<br>20. Après le repas, la femme range la table et la nappe.<br><br>21. La femme fait la vaisselle et range la cuisine.<br>[b]22. L’homme laisse le barbecue en place car il y a encore des braises.[/b]<br>&nbsp;<br>[b]23. L&#39;homme demande à la femme si elle a apprécié de ne pas faire la cuisine aujourd’hui.[/b]<br>&nbsp;<br>[b]24. Et devant son air dubitatif, l&#39;homme conclut que les femmes ne sont jamais satisfaites.[/b]<br>La nature nous a donné deux oreilles et seulement une langue afin de pouvoir écouter d&#39;avantage et parler moins.<br>ZENON D&#39;ELÉE<br>&nbsp;','xx',1,0),(75,12,13,1441011765,2,75,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Je vivrai chaque jour comme si c&#39;était mon dernier.','xx',1,0),(76,42,12,1441013344,2,76,'Re : Images','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Bonheur','clip',1,0),(77,45,19,1441016898,2,77,'Balance','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Le Lion récolte. La Vierge évalue et conserve la récolte en séparant le bon grain de l&#39;ivraie.&nbsp;[size=2]C&#39;est à la Balance que revient la tâche de la répartir équitablement.[/size]<br>[size=2]C&#39;est le signe de l&#39;équilibre, de l&#39;harmonie, de la justice, de la paix.[/size]<br>[size=2]La Balance sélectionne et tranche instinctivement. Son royaume est celui de la justice.[/size]<br>Il représente autrui, la comparaison, l&#39;opposition, la complémentarité.<br>C&#39;est le signe de l&#39;union, du mariage, des associations et des contrats.&nbsp;<br>Il est gracieux, élégant, a peur de la solitude, a des dons pour la danse.<br>[size=2]Il est doux, a besoin d&#39;être aimé, a le goût du beau et du vrai.[/size]<br>Il montre la vie sociale, les réunions, les rencontres, et les mondanités.<br>Il exprime le choix, les hésitations; il apporte l&#39;arbitrage, la conciliation, l&#39;équité ou l&#39;injustice.<br>C&#39;est un signe artistique, raffiné, mais snob.&nbsp;<br>Il aime la flatterie, la mode, l&#39;esthétisme, la beauté, la facilité, la diplomatie et les conventions.<br>[size=2]L&#39;attachement aux principes, aux formes, aux normes peut-être parfois poussé à l&#39;extrême, ainsi qu&#39;un caractère influençable, l&#39;indécision, le refus de prendre parti ou de s&#39;engager.[/size]','xx',1,0),(78,46,19,1441021384,2,78,'Scorpion','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Il représente la mort et la sexualité.<br>C&#39;est le signe des instincts, du désir sexuel, de la passion destructrice. Il apporte le mystère, le secret, les ténèbres, mais aussi le régénération, la mutation, la transformation, la résurrection et le réincarnation.<br>Il représente les pouvoirs cachés, la magie noire et l&#39;espionnage.<br>Il aime le drame (parfois sadique) .&nbsp;<br>Il détruit pour reconstruire.<br>[size=2]Il est extrémiste, tyrannique, concentré,&nbsp;[/size]rancunier[size=2], jaloux, possessif, haineux, envieux et vengeur.[/size][size=2]&nbsp;[/size]<br>[size=2]C&#39;est le signe de l&#39;érotisme et de la pornographie.[/size]<br>[size=2]C&#39;est aussi un signe de richesse, de trésors cachés ou de dons cachés comme le magnétisme. Il aime le pouvoir. Son esprit est pénétrant et hypercritique et il est arriviste.&nbsp;[/size]<br>[size=2]Il est exigeant avec lui-même et avec autrui. Remise en question fréquente.&nbsp;[/size]<br>[size=2]C&#39;est le signe des héritages.[/size]<br>[size=2]Ce signe du zodiaque rassemble les pulsions de vie et de mort dans une projection sourde, intériorisée, intense vers le futur. Mais il s&#39;agit là d&#39;un futur neuf. D&#39;où le goût du risque calculé des natifs de ce signe,[/size]<br>[size=2]leur caractère anticonformiste, provocateur, audacieux, leur esprit de révolte, leur intérêt marqué pour l&#39;insolite, l&#39;étrange, l&#39;inédit et l&#39;interdit, leur énergie magnétique parfois destructrice, autodestructrice ou profondément régénératrice.[/size]<br>[size=2]Il veut toucher le fond pour fouiller, explorer et rebondir, quitte à y laisser sa peau.[/size]','xx',1,0),(79,47,19,1441025069,2,81,'Sagittaire','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1441094170,'Alexandra','','Il marque l&#39;évolution intellectuelle ou spirituelle et les études supérieures. Il représente la philosophie, l&#39;ésotérisme, la théologie, la religion et la loi.<br>C&#39;est le signe des grands voyages, de l&#39;outre-mer, de l&#39;étranger et des routes à plusieurs voies (contrairement aux Gémeaux qui représentent les petites routes). <br>C&#39;est un éternel enfant, optimiste et toujours de bonne humeur. <br>Il a le goût de la chasse, des courses de chevaux et du sport (de la vie au grand air, du camping).<br>Il marque les prophètes, les gourous, les explorateurs, les leaders spirituels.<br>C&#39;est le signe des rêves (notamment ceux qui sont prophétiques).<br>Il est indépendant, adaptable, joueur, aventurier, imprudent, jovial, enthousiaste, joyeux et tonique.<br>Il a bonne mine. Il se sent chanceux.<br>C&#39;est le signe de la maturité et, dans un certain sens, celui du père qui guide et qui protège.<br>On doit ajouter à ce tableau sympathique la sincérité, la bonne foi, la simplicité, l’honnêteté, et leurs revers qui rendent parfois les natifs de ce signe joueurs, tricheurs, intransigeants, violents, exclusifs et excessifs.<br>Les besoins d&#39;établir un contact physique avec le monde, de dépenser ses énergies, d&#39;élargir son horizon, d’expansion naturelle, de conquête et d&#39;exploit sont toutefois d&#39;excellents catalyseurs pour ce signe qui conduit l&#39;être à jouir et à s&#39;épanouir pleinement.','xx',1,0),(80,48,19,1441025093,2,81,'Capricorne','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1441095017,'Alexandra','','[size=2]C&#39;est le signe de la montagne, du sommet à atteindre, d&#39;où ambition et élévation sociale lente mais sûre.[/size]<br>[size=2]Il représente l&#39;avarice, la frugalité, le dépouillement, la vieillesse, la solitude, la réalisation, l&#39;économie, la patience, la persévérance. [/size]<br>[size=2]Il indique les postes élevés, de confiance, à responsabilités. Il montre le devoir, la méthode, l&#39;organisation, l&#39;intégrité, le sang-froid, la prudence, le pessimisme, l&#39;intériorité, le rigoriste, les retards, l&#39;expérience, le détachement, le recueillement, la sagesse et la frustration.[/size]<br>[size=2]En général, il a du sens pratique et il est de bon conseil.[/size]<br>[size=2]C&#39;est le signe de l&#39;administration et aussi de la connaissance.[/size]<br>[size=2]Par analogie avec cette période de l&#39;année &nbsp;où la nature lutte contre les&nbsp;rigueurs&nbsp;du froid et du gel, le signe du Capricorne met en place un système&nbsp;d’autodéfense, une volonté de se suffire à lui même qui conduisent&nbsp;parfois&nbsp;certains natifs de ce signe à la défiance, à la&nbsp;misanthropie, au pessimisme, au scepticisme, au refus de tout abandon et de tout laisser-aller, voire à l&#39;indifférence.[/size]<br>[size=2]Par compensation, la lucidité s&#39;en trouve exaltée, ainsi que la logique, la&nbsp;ténacité, l&#39;ambition, le pouvoir de concentration, de réflexion, de maturation, la capacité de se nourrir de l&#39;expérience.&nbsp;[/size]<br>[size=2]Ne comptant que sur lui même et étant sereinement préparé au pire, le natif&nbsp;du&nbsp;Capricorne possède beaucoup de sang-froid. Il est patient,&nbsp;persévérant, raisonnable et solitaire.[/size]<br><br>','xx',1,0),(81,12,13,1441059228,2,81,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','[size=2]Je suis en train de changer ma vie par mes actions,[/size]<br>C&#39;est un choix qui m&#39;appartient.<br>&nbsp;','xx',1,0),(82,49,19,1441102291,2,82,'Verseau','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1441102681,'Alexandra','','C&#39;est le signe du futur.<br>Il est avant gardiste, moderne, humaniste, individualiste, altruiste, indépendant, sympathique et révolté.<br>Il a des idées et de l&#39;humour. <br>Il symbolise la science, l&#39;avenir, la prospective, l&#39;espace, les communications modernes (tv, cinéma, vidéo, satellite, ordinateur).<br>Il est le signe de l&#39;amitié, de l&#39;invention, de l&#39;originalité, de l&#39;utopie, de l&#39;explosion. <br>Il a un esprit de contradiction.<br>Il représente les moyens modernes de transport (train, avions, fusée...) <br>Son esprit non conformiste le pousse ) à la révolte, à la contestation systématique. <br>Son ouverture d&#39;esprit, son sens inné de la collaboration font des natifs de la fraternité, de la liberté, de la politique, de l&#39;excentricité et de la recherche d&#39;une connaissance.<br>','xx',1,0),(84,51,19,1441188216,2,84,'Poissons','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','C&#39;est le signe de l&#39;infini, de ce qui est illimité, de la foi de la mystique.&nbsp;<br>Il apporte des dons artistiques ( musique, danse et comédie ).<br>Il symbolise l&#39;inspiration créatrice, l&#39;imagination, l&#39;image, l&#39;institution et la clairvoyance.&nbsp;<br>Il apporte le sacrifice, le mystère, le secret, la dramatisation, la rêverie, le merveilleux, le conte, l&#39;hésitation, la résignation et la nonchalance.<br>Il peut se montrer faible, paresseux, superstitieux.<br>C&#39;est le domaine de l&#39;image, de l&#39;illusion, de la trahison, la résignation et la nonchalance.<br>Il peut se montrer faible, paresseux, superstitieux.<br>C&#39;est le domaine de l&#39;image, de l&#39;illusion, de la trahison mais aussi de la douceur, du dévouement et de la gentillesse.<br>Il fuit; il nage entre deux eaux; il est silencieux, discret, paisible et parfois dissimulateur.<br>C&#39;est un signe philanthrope, sensitif, romanesque, réceptif et compatissant.<br>Il est sentimental, impressionnable, sensible et influençable.<br>C&#39;est le signe de la photographie, du sommeil, de la relaxation, de la sophrologie et de toutes les drogues.<br>Il est naïf mais protégé.<br>Le Poisson est naturellement en osmose avec les aspects visibles et invisibles de son milieu naturel qui le submergent parfois ou qui le poussent aux excès de sensibilité, d&#39;émotivité, de sentimentalisme, à l&#39;auto-illusion, à l’anxiété, à la passivité, à la sublimation, à l&#39;idéalisme ou au génie créateur.<br>Il est ainsi capable de repli sur soi tout autant que de généreuse expansion.','xx',1,0),(85,12,13,1441188527,2,85,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Je simplifie ma vie, je me débarrasse du désordre et des activités non fécondes.','xx',1,0),(86,12,13,1441280781,2,86,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','Je fais face avec courage, je reste calme.','xx',1,0),(87,52,26,1441282143,2,87,'Transformez Votre Vie Par l\'Astrologie','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,1441283004,'Alexandra','','[b]Transformez Votre Vie Par l&#39;Astrologie[/b]<br><br>Ce livre vous aidera à comprendre votre vie passée, présente, future et vous permettra de réfléchir sur les positions et choix à faire.<br>Pratique de la nouvelle astrologie: comment calculer votre carte du ciel, en comprendre les symboles et l’interpréter.<br>Le calcul du temps sidéral, de votre ascendant, de la position de vos planètes...<br>Découvrir l’alphabet astrologique, les clefs du zodiaque, le message des astres, la communication astrale...<br>Les cheminements de l&#39;interprétation astrologique<br><br>Art ancestral, l&#39;astrologie est ici traitée de façon résolument moderne, dans un style nouveau par rapport à l&#39;astrologie classique, avec des définitions plus adaptées au mode de pensée de l&#39;homme d&#39;aujourd&#39;hui.<br><br>Ce livre vous aidera à mieux connaître et maîtriser votre destin, par des méthodes nouvelles d&#39;interprétation, comme la technique des modèles de répartitions planétaires.<br><br>Présenté en trois parties, il vous apprend à calculer votre carte du ciel, vous donne les définitions symboliques de tous ses éléments, et vous enseigne les bases de l&#39;interprétation.<br><br>De nombreux exemples et exercices pratiques complètent cet ouvrage enrichissant, original et passionnant.<br><br>Pierre Lassale<br><br>ISBN 2-7328-2804-1','xx',1,0),(88,53,26,1441310430,2,88,'Manuel¨Pratique d\'Astrologie','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','[b]Manuel¨Pratique d&#39;Astrologie[/b]<br><br>L&#39;astrologie vous passionne mais les calculs vous effraient!<br>Didier Colin, vous livre ici les clés d&#39;une astrologie enfin accessible.<br>Alors, entrez dans la pratique et suivez l&#39;enseignement d&#39;un professionnel.','xx',1,0),(89,12,13,1441354386,2,89,'Re : Phrase positive','Alexandra','alexandra7voyante@gmail.com','85.27.74.173',1,0,'','','J&#39;ai le droit et le devoir d&#39;être moi-même,<br>Mon succès sera à la mesure de mon affirmation,<br>Je m&#39;affirme de plus en plus dans tous les domaines de mon existence.','xx',1,0);
