INSERT INTO `smf_user_drafts` VALUES (33,16,7,0,0,1440102262,2,'Re : Pendule ou tout autre objet',0,'[b]Testez-moi gratuitement[/b], envoyez une question, accompagnée de votre nom, prénom, date de naissance et région. <br>[b][email=alexandra@sublime-voyance.be]alexandra@sublime-voyance.be[/email][/b]<br>Je vous répondrai maximum dans les 48 heures.<br>Cette offre n&#39;est valable qu&#39;une seule fois!<br><br>Consultation immédiate: [b]0907/37 157[/b] (1,50€/min)','xx',0,0,''),(34,5,1,0,0,1440104467,1,'Charte',0,'Introduction:<br><br>Ce forum se veut être un espace de discussions et d&#39;échanges entre passionnés. Pour que chacun puisse passer un moment en toute convivialité, voici quelques règles de bonne conduite à observer<br><br>1- Objet du forum:<br><br>Ce forum regroupe les membres de Sublime-Voyance. Les thèmes abordés porteront essentiellement sur la parapsychologie sous toutes ses formes. Ce forum a donc pour objectif de faciliter la communication et le partage d&#39;information.<br><br>2- Modalités d&#39;accès au forum:<br>Pour prendre connaissance des messages postés sur notre forum, une inscription est obligatoire<br>En effet, la majeure partie des sujets de ce forum peut être lue par tous. En revanche, quelques rubriques sont protégées et seuls les membres adhérents au Staff peuvent poster des messages.<br><br>3- Les règles du forum:<br><br>- Politesse et savoir-vivre: respectez les membres, utilisez des formules de politesse, restez calme.<br>- Tous propos diffamatoires, injurieux, insultants, racistes, xénophobes ou obscènes sont interdits sur le forum.<br>- N&#39;abusez pas de l&#39;écriture en majuscules. En effet, ces dernières symbolisent un internaute qui CRIE.<br>- [color=red][b]Pour une lecture agréable de ce forum, nous vous incitons à soigner votre orthographe, votre syntaxe et à ne pas utiliser le langage sms.[/b][/color] Nous vous en remercions par avance.<br><br>4- Le rôle du modérateur:<br><br>Le rôle du modérateur est de faire respecter les règles de bonne conduite pour rendre les espaces de discussions conviviaux et agréables à tous, en adéquation avec les lois du pays (définis par le cadre juridique du pays).<br><br>Les missions du modérateur sont : <br><br>- Supprimer des messages ou des discussions ne respectant pas les règles de bonne conduite.<br>- Supprimer les profils qui nuisent au bon fonctionnement du forum, par exemple via des messages insultants, des messages provocateurs, du prosélytisme religieux ou politique, racistes, xénophobes, etc. <br>- Sont concernés également les utilisateurs qui utilisent simultanément plusieurs profils différents sur le même forum : c&#39;est une attitude que nous assimilons à de la malhonnêteté envers les autres utilisateurs et donc non admise sur notre forum.<br>- Répondre à vos alertes ou demandes particulières.<br>- Effacer tout propos interdit sur le site tel que par exemple des propos racistes, diffamatoires, insultants, xénophobes, pédophiles... Que ces propos soient explicites ou implicites, ils seront supprimés.<br>- Retirer tout contenu texte, post, photo ou vidéo illicites<br><br>Le modérateur intervient a posteriori et n’intervient pas dans les discussions pour donner son avis, ni lors d’un conflit pour donner raison a un internaute. Si un message vous semble contraire aux règles de bonne conduite énoncées ici, signalez-le au modérateur en cliquant sur le bouton &quot;Modérateur&quot; qui figure en bas de page du forum. Vous pourrez lui envoyer un MP .<br><br>Bien à Vous<br><br>Alexandra: Administrateur','xx',0,0,''),(37,0,18,0,0,1440156132,2,'Les signes de Terre',0,'uuu','xx',0,0,''),(39,33,18,0,0,1440158113,2,'Les signes d\'Air',0,'[size=2][size=2][font=Verdana, sans-serif][b]Gémeaux[/b][/font][/size][/size]<br>[size=2][size=2][font=Verdana, sans-serif]Tous les métiers de la communication et des transports (journaliste,[/font][/size][size=2][font=Verdana, sans-serif]écrivain, éditeur, facteur, libraire, etc.). Certains sports comme les coureurs&nbsp;[/font][/size][size=2][font=Verdana, sans-serif]à pied, les cyclistes, les gymnastes et les tennismen. Les professions du&nbsp;[/font][/size][size=2][font=Verdana, sans-serif]commerce en boutique ou sur les marchés. En médecine: les spécialistes des poumons ou de la circulation.[/font][/size][/size]<br><br>','xx',0,0,''),(42,33,18,0,0,1440230001,2,'Les signes d\'Air et leur proffessions',0,'[size=2][size=2][font=Verdana, sans-serif][b]Gémeaux[/b][/font][/size][/size]<br>[size=2][size=2][font=Verdana, sans-serif]Tous les métiers de la communication et des transports (journaliste,[/font][/size][size=2][font=Verdana, sans-serif]écrivain, éditeur, facteur, libraire, etc.). Certains sports comme les coureurs [/font][/size][size=2][font=Verdana, sans-serif]à pied, les cyclistes, les gymnastes et les tennismen. Les professions du [/font][/size][size=2][font=Verdana, sans-serif]commerce en boutique ou sur les marchés. En médecine: les spécialistes des poumons ou de la circulation.[/font][/size][/size]<br><br>[b]Balance[/b]<br>Tous les métiers où l&#39;équilibre est important comme ceux de danseur ,[size=2]gymnaste ou équilibriste. Toutes les professions de la justice (avocat, [/size][size=2]juge, etc.) .[/size]<br>Les métiers de la beauté, de l&#39;esthétique ou de la décoration. Certaines [size=2]professions artistiques comme peintre ou styliste.[/size]<br>En médecine: urologue, néphrologue et diabétologue. Et aussi: professeur [size=2]de musique et les métiers en rapport avec les poids (ascenseur ... ).[/size]<br><br>[b]Verseau[/b]<br>[size=2]Les métiers liés à la politique et à des organismes internationaux comme [/size][size=2]l&#39;ONU ou !&#39;Unesco. Toutes les professions modernes , nouvelles. Toutes [/size][size=2]les professions liées aux moyens actuels de communication ou de transport [/size][size=2](télex, informatique, aviation, télévision, cinéma, etc.). [/size][size=2]Et aussi: écrivain de science-fiction , astrologue , psychologue, électronicien, [/size][size=2]publiciste, radiologue. phlébologue, ingénieur, [/size][size=2]magnétiseur, parapsycbologue [/size][size=2]et les carrières de l&#39;automobile.[/size]<br>','xx',0,0,''),(46,12,13,0,0,1440246596,2,'Re : Phrase positive',0,'Je cultive le calme.','xx',0,0,''),(47,0,12,0,0,1440246738,2,'Les Astres, les Dieux, les Mythes et les Symboles',0,'Je viens de commencer un nouveau sujet sur&nbsp;Les Astres, les Dieux, les Mythes et les Symboles, j&#39;aimerais que chacun des membres ou nouveau membre<br>[color=#ffffff][size=2][font=Tahoma, sans-serif][iurl=http://&quot;http://forum.sublime-voyance.be/index.php?action=unread;c=9&quot;]Les Astres, les Dieux, les Mythes et les Symboles[/iurl][/font][/size][/color]','xx',0,0,''),(48,0,12,0,0,1440249504,2,'Participation',0,'<br>[size=2]Bonjour, bonsoir, le staff du forum aimerait une participation active de ses membres et nouveau membre au niveau des différents sujets proposés, afin, d&#39;avoir une animation et d&#39;obtenir un forum vivant.[/size]<br>[size=2]De façon à ce qu&#39;il ne reste pas dans les oubliettes du web, car un forum non actif n’apparaîtra pas sur la première page des moteurs de recherche grâce au référencement naturel.[/size]<br><br>[size=2]Alors aidez nous à y parvenir.[/size]<br>','xx',0,0,''),(49,12,13,0,0,1440838119,2,'Re : Phrase positive',0,'Désormais je savoure chacune de mes actions.','xx',0,0,'');
